INSERT INTO `messages` VALUES (26,'Hola Mirna, qu&eacute; tal. Acabo de leer la planeaci&oacute;n de la semana y me gustar&iacute;a comentarte lo siguiente. Andr&eacute; ha avanzado a partir de los conocimientos adquiridos desde el ciclo anterior, es decir que el conteo con mas menos errores es hasta el 30. Entiendo que empiezas desde el 1,2 y 3 para repasar y sobretodo para equilibrar en la medida de lo posible el nivel de alumnos que se incorporan al ambiente y a la escuela, sin embargo esto puede impactar en definitiva en una menor atenci&oacute;n y p&eacute;rdida de inter&eacute;s de Andr&eacute; en cuestiones relacionadas con la escuela.','2020-08-29 20:03:44',292,21,292,21,'read','false'),(27,'En este sentido quisiera que en equipo acordemos si las sesiones con este grupo de alumnos es conveniente y en este sentido revisemos los contenidos y el nivel. Si gustas puedo enviarte videos, fotos, o las evidencias que bajo tu orientaci&oacute;n pueda yo enviarte para que hagas un diagn&oacute;stico m&aacute;s profundo.','2020-08-29 20:05:58',292,21,292,21,'read','false'),(28,'Seguramente en el poco tiempo de convivencia con Andr&eacute;, lograste percibir que busca retos y situaciones desafiantes constanemente, tiene aspectos de gran avance as&iacute; como actitudes de menor madurez como baja tolerancia a la frustraci&oacute;n, su tolerancia, paciencia, constancia y tenacidad. ','2020-08-29 20:07:28',292,21,292,21,'read','false'),(29,'Todos estamos aprendiendo en este camino, lo &uacute;nico que pretendo es que el inter&eacute;s de Andr&eacute; se mantenga y que su desarrollo humano y acad&eacute;mico sean potenciados. Estamos m&aacute;s que abiertos a su ayuda y sugerencias. Saludos','2020-08-29 20:08:34',292,21,292,21,'read','false'),(30,'Pd. No puedo subir evidencias, al parecer hay un error en la plataforma','2020-08-29 21:33:34',292,21,292,21,'read','false'),(31,'hola lul&uacute; tengo que investigar de los s&iacute;mbolos pero no me acuerdo de que s&iacute;mbol