lde;os para que ellos los manipulen. ','2021-02-18 16:48:48',298,19,298,19,'unread','false'),(1345,'Y para tomar su aguita.','2021-02-18 16:49:11',298,19,298,19,'unread','false'),(1346,'Ojal&aacute; nos puedas avisar el d&iacute;a para organizarnos en casa. Gracias','2021-02-18 16:49:34',298,19,298,19,'unread','false'),(1540,'hola','2021-03-13 21:46:44',34,407,34,407,'read','false'),(1541,'hola\n','2021-03-13 21:46:58',407,34,407,34,'unread','false');
